import React from 'react';

const Navigat = (props) => {
	return(
		<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
			<p onClick={props.onRouteChange('home')} className='f3 link dim black underline pa4 pointer'> Sign Out </p>
		</nav>
	);
}

export default Navigat;
